                    sourcesContent: ["@use 'scss/colors';\n@use 'scss/sizes';\n\n$mfa-paragraph-spacing: sizes.$x18;\n\n// FIXME: should not depend on another header's CSS. Standardize modal headers\n.modal--mfa-setup .table-media-preview-header__title {\n  font-size: sizes.$x14;\n  font-weight: 600;\n\n  .k-icon {\n    color: colors.$kobo-blue;\n    position: relative;\n    top: sizes.$x2;\n    padding-right: sizes.$x12;\n  }\n}\n\n.mfa-modal {\n  padding: sizes.$x30 sizes.$x60 0; // bottom padding is handled by footer\n  height: 100%;\n  display: flex;\n  flex-direction: column;\n\n  p {\n    margin: 0;\n  }\n}\n\n// HACK override for TextBox component\n.mfa-modals-textbox input {\n  text-align: center;\n  font-size: sizes.$x18 !important;\n  font-weight: 400 !important;\n}\n\n.mfa-modal__body {\n  flex: 1;\n}\n\n.mfa-modal__p {\n  &.mfa-modal__p--align-right {\n    text-align: right;\n  }\n}\n\n.mfa-modal__body,\n.mfa-modal__description {\n  .mfa-modal__p,\n  .mfa-modal__codes-wrapper,\n  .mfa-modal__qrcode-wrapper,\n  ul {\n    margin: 0;\n\n    &:not(:last-child) {\n      margin-bottom: $mfa-paragraph-spacing;\n    }\n  }\n}\n\n.mfa-modal__description + .mfa-modal__body {\n  margin-top: $mfa-paragraph-spacing;\n}\n\n// Individual steps separeted out from parent for readability\n.mfa-modal--step-qr {\n  canvas {\n    display: block;\n    padding: sizes.$x14;\n    border: sizes.$x1 solid colors.$kobo-gray-400;\n    border-radius: 3%;\n    margin: 0 auto;\n  }\n}\n\n.mfa-modal__codes {\n  text-align: center;\n  background-color: colors.$kobo-gray-300;\n  border: sizes.$x1 solid colors.$kobo-gray-400;\n  border-radius: sizes.$x5;\n  padding: sizes.$x12;\n  line-break: anywhere;\n\n  .mfa-modal__list {\n    padding-top: sizes.$x24;\n\n    > li {\n      padding-bottom: sizes.$x24;\n    }\n  }\n\n  &:not(:last-child) {\n    margin-bottom: $mfa-paragraph-spacing;\n  }\n}\n\n.mfa-modal__help-link {\n  cursor: pointer;\n}\n\n.mfa-modal__footer {\n  display: flex;\n  justify-content: space-between;\n  margin-top: sizes.$x30;\n  padding-bottom: sizes.$x60;\n\n  .mfa-modal__footer-left {\n    width: 40%;\n  }\n\n  .mfa-modal__footer-right {\n    width: 40%;\n    margin-left: auto;\n    order: 2;\n  }\n}\n\n.mfa-modal.mfa-modal--step-manual,\n.mfa-modal.mfa-modal--step-backup,\n.mfa-modal.mfa-modal--step-qr {\n  .mfa-modal__body {\n    display: flex;\n    flex-direction: column;\n\n    .mfa-modal__codes-wrapper,\n    .mfa-modal__qrcode-wrapper {\n      display: flex;\n      flex-direction: column;\n      justify-content: center;\n      flex: 1;\n    }\n  }\n}\n", "/*\n * A temporary-ish file for defining all the sizes we use in the app to avoid\n * creating unnecessary new ones. Ultimately we would like to have a small\n * nice palette and start merging similar ones. This will also help us find\n * how many of each of them we use.\n */\n@use 'sass:math';\n\n// absolute sizes\n$x1: 1px;\n$x2: 2px;\n$x3: 3px;\n$x4: 4px;\n$x5: 5px;\n$x6: 6px;\n$x8: 8px;\n$x10: 10px;\n$x12: 12px;\n$x13: 13px;\n$x14: 14px;\n$x15: 15px;\n$x16: 16px;\n$x18: 18px;\n$x20: 20px;\n$x21: 21px;\n$x22: 22px;\n$x24: 24px;\n$x28: 28px;\n$x30: 30px;\n$x32: 32px;\n$x36: 36px;\n$x38: 38px;\n$x40: 40px;\n$x48: 48px;\n$x50: 50px;\n$x60: 60px;\n$x80: 80px;\n$x100: 100px;\n$x120: 120px;\n$x140: 140px;\n$x150: 150px;\n$x180: 180px;\n$x200: 200px;\n$x300: 300px;\n$x350: 350px;\n$x400: 400px;\n$x600: 600px;\n$x800: 800px;\n\n// takes a pixel dimension and returns it in rem\n@function pxToRem($size) {\n  $remSize: math.div($size, 16px);\n  @return #{$remSize}rem;\n}\n\n// relative sizes (rem units - scales with root document font size)\n$r12: pxToRem($x12);\n$r14: pxToRem($x14);\n$r16: pxToRem($x16); // 1em at default font size of 16px\n$r18: pxToRem($x18);\n\n", "// Kobo global palette of colors.\n\n/*\n * The Kobo neutral scale\n */\n\n// (accessible) our black, very very rare, only use if necessary for contrast\n$kobo-gray-900: hsl(225deg 17% 14%); // #1e212a\n\n// (accessible) active text, important text, text on background, top navigation\n// background\n$kobo-gray-800: hsl(225deg 16% 24%); // #333847\n\n// (accessible) default text, inactive text, options text, buttons text,\n// tabs text, notifications background, hover for popups and dropdowns\n$kobo-gray-700: hsl(226deg 16% 42%); // #5a627d\n\n// (readable) clickable icons on hover\n$kobo-gray-600: hsl(225deg 16% 58%); // #828ba5\n\n// icons default (clickable), arrows and indicators default\n$kobo-gray-500: hsl(226deg 16% 70%); // #a6acbf\n\n// inactive icons, some decorative icons\n$kobo-gray-400: hsl(228deg 16% 82%); // #cacdd9\n\n// scroll bars, table lines, dividers, background of clickable icons on hover\n// when also in a highlighted table row\n$kobo-gray-300: hsl(227deg 18% 90%); // #e1e3ea\n\n// default light background, icons on hover, sidebar menu, table headings, \n$kobo-gray-200: hsl(228deg 16% 94%); // #edeef2\n\n// table row highlight on hover\n$kobo-gray-100: hsl(240deg 20% 98%); // #f9f9fb\n\n// white background\n$kobo-white: hsl(0deg 0% 100%); // #ffffff\n\n/*\n * Primary colours & shades\n */\n\n$kobo-dark-blue: hsl(207deg 77% 32%); // #135991\n$kobo-hover-blue: hsl(207deg 77% 43%); // #1977c2\n$kobo-blue: hsl(207deg 90% 54%); // #2095f3\n$kobo-mid-blue: hsl(207deg 90% 77%); // #8fcaf9 (previously $kobo-alt-blue)\n$kobo-light-blue: hsl(207deg 88% 91%); // #d2e9fc (previously $kobo-mid-blue)\n$kobo-bg-blue: hsl(206deg 84% 95%); // #e8f4fd (previously $kobo-light-blue)\n\n$kobo-dark-teal: hsl(185deg 57% 25%); // #1b5e64\n$kobo-hover-teal: hsl(185deg 57% 35%); // #26838c\n$kobo-teal: hsl(185deg 57% 57%); // #52c5d0\n$kobo-mid-teal: hsl(186deg 57% 75%); // #9bdde4\n$kobo-light-teal: hsl(185deg 58% 85%); // #c3ebef\n$kobo-bg-teal: hsl(188deg 60% 95%); // #ebf8fa\n\n/*\n * Secondary & tertiary colors\n */\n\n$kobo-storm: hsl(224deg 33% 59%); // #7386b9\n$kobo-mid-storm: hsl(223deg 34% 79%); // #b8c2dc\n$kobo-light-storm: hsl(225deg 31% 95%); // #eef0f6 (previously $kobo-cloud)\n\n$kobo-purple: hsl(290deg 53% 65%); // #c577d5\n$kobo-violet: hsl(290deg 53% 85%); // #e6c5ed\n$kobo-pink: hsl(290deg 53% 93%); // #f4e5f7\n\n$kobo-dark-red: hsl(0deg 100% 26%); // #850000\n$kobo-red: hsl(0deg 100% 31%); // #9d0000 (previously $kobo-dark-red)\n$kobo-mid-red: hsl(0deg 100% 75%); // #ff8080 (previously $kobo-red)\n$kobo-hover-red: hsl(0deg 100% 90%); // #ffcccc\n$kobo-light-red: hsl(0deg 100% 96%); // #ffe9e9\n\n$kobo-dark-amber: hsl(30deg 100% 25%); // #803f00\n$kobo-amber: hsl(29deg 100% 75%); // #ffbe80\n$kobo-light-amber: hsl(30deg 100% 90%); // #ffe8cc\n\n$kobo-dark-green: hsl(146deg 71% 31%); // #178949\n$kobo-green: hsl(146deg 72% 75%); // #92edba\n$kobo-light-green: hsl(147deg 69% 95%); // #e3f9db (previously $kobo-lime)\n"],
